package com.syntax.class09;

public class InclassTask02 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		//decrement
	for(int a=5;a>0;a--) {
			
			for(int b=5;b>0;b--) {
				System.out.print(b);
			}
			System.out.println();
		}
	
	for(int a=5;a>0;a--) {
		
		for(int b=5;b>0;b--) {
			System.out.print(a);
		}
		System.out.println();
	}
	
	
	}

}
